// Meio.jsx
import React from "react";

function Meio({ dados }) {
  return (
    <div className="meio">
      <div className="janela">
        {dados && (
          <div>
            <pre>{JSON.stringify(dados, null, 2)}</pre>
          </div>
        )}
      </div>
    </div>
  );
}

export default Meio;
